import React from "react";
import "../App.css";

export const Lines = () => {
    return(
      <div>
        <span>First point</span>
        <input type="text" placeholder="Width"></input>
        <input type="text" placeholder="Height"></input>
        <span>Second point</span>
        <input type="text" placeholder="Width"></input>
        <input type="text" placeholder="Height"></input>
      </div>
    )
}
